import React from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
const Navbar = () => {
    return (<>
        <nav class="navbar bg-light">
            <div class="container fw-semibold font-monospace ">
                <a class="navbar-brand" href="jj">
                    <img src="https://www.amfori.org/sites/default/files/webform/membership/logo/logo-ohne-kontur-1.gif" alt="Bootstrap" width="60" height="40" />
                </a>
                <h2 className="shadow_t"> KEEP INFO</h2>
            </div>
        </nav>

    </>)
}
export default Navbar;
